// SPDX-License-Identifier: GPL-3.0

pragma solidity >=0.7.0 <0.9.0;

contract Array1 {
    uint[] public array = [1, 2, 3, 4, 5];

    function remove(uint _index) external {
        require(_index < array.length);
        for (uint i = _index; i < array.length - 1; i++) {
            array[i] = array[i+1];
        }
        array.pop();
    }
}

